import React from 'react';
import './App.css';
import Router from './router/router'
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (

    <div className="App">
      <BrowserRouter>
        <Router/>
      </BrowserRouter>
    </div>
  );
}

export default App;
